void drawBG(void){
	ST7735_DrawBitmap(0, 160, UIBG, 128, 160);
}

void drawLives(uint8_t livesCount){
	switch (livesCount){
		case 1:
			ST7735_DrawBitmap(lifeBottomX, lifeBottomY, lifesprite, lifeWidth, lifeHeight);
			ST7735_FillRect(lifeBottomX + lifeWidth + lspace, lifeBottomY, 0, lifeWidth, lifeHeight);
			ST7735_FillRect(lifeBottomX + (lifeWidth + lspace)*2, lifeBottomY, 0, lifeWidth, lifeHeight);
		case 2:
			ST7735_DrawBitmap(lifeBottomX, lifeBottomY, lifesprite, lifeWidth, lifeHeight);
			ST7735_DrawBitmap(lifeBottomX + lifeWidth + lspace, lifeBottomY, lifesprite, lifeWidth, lifeHeight);
			ST7735_FillRect(lifeBottomX + (lifeWidth + lspace)*2, lifeBottomY, 0, lifeWidth, lifeHeight);
		case 3:
			ST7735_DrawBitmap(lifeBottomX, lifeBottomY, lifesprite, lifeWidth, lifeHeight);
			ST7735_DrawBitmap(lifeBottomX + lifeWidth + lspace, lifeBottomY, lifesprite, lifeWidth, lifeHeight);
			ST7735_DrawBitmap(lifeBottomX + (lifeWidth + lspace)*2, lifeBottomY, lifesprite, lifeWidth, lifeHeight);
		case 0:
			drawBG();
	}
}

void drawBombs(uint8_t bombsCount){
	switch (bombsCount){
		case 1:
			ST7735_DrawBitmap(bombBottomX + bspace, bombBottomY, bombsprite, bombDimension, bombDimension);
			ST7735_FillRect(bombBottomX + bombDimension + bspace, bombBottomY - bspace*4, 0, bombDimension, bombDimension);
			ST7735_FillRect(bombBottomX + bombDimension*2 + bspace, bombBottomY, 0, bombDimension, bombDimension);
		case 2:
			ST7735_DrawBitmap(bombBottomX + bspace, bombBottomY, bombsprite, bombDimension, bombDimension);
			ST7735_DrawBitmap(bombBottomX + bombDimension + bspace, bombBottomY - bspace*4, bombsprite, bombDimension, bombDimension);
			ST7735_FillRect(bombBottomX + bombDimension*2 + bspace, bombBottomY, 0, bombDimension, bombDimension);
		case 3:
			ST7735_DrawBitmap(bombBottomX + bspace, bombBottomY, bombsprite, bombDimension, bombDimension);
			ST7735_DrawBitmap(bombBottomX + bombDimension + bspace, bombBottomY - bspace*4, bombsprite, bombDimension, bombDimension);
			ST7735_DrawBitmap(bombBottomX + bombDimension*2 + bspace, bombBottomY, bombsprite, bombDimension, bombDimension);
		case 0:
			ST7735_FillRect(bombBottomX + bspace, bombBottomY, 0, bombDimension, bombDimension);
			ST7735_FillRect(bombBottomX + bombDimension + bspace, bombBottomY - bspace*4, 0, bombDimension, bombDimension);
			ST7735_FillRect(bombBottomX + bombDimension*2 + bspace, bombBottomY, 0, bombDimension, bombDimension);
	}
}

